const Admin = async () => {
    await axios({
        method: "post",
        url: "/api/login",
        data: {
            email,
            password,
        },
    });
    await axios({
        method: "get",
        url: "/api/user",
    });

    return <div className="container">Admin</div>;
};
export default Admin;
